import React from "react";
import { withRouter } from "react-router-dom";
import {
  Container,
  Card,
  CardContent,
  Typography,
  withStyles,
  TextField,
  Grid,
  Button,

  // Link
} from "@material-ui/core";
import Autocomplete from "@material-ui/lab/Autocomplete";

import DialogComponent from "../../components/dialog/index";
import CheckCircleOutlineIcon from "@material-ui/icons/CheckCircleOutline";
import CheckboxLabels from "../../components/checkbox/index2";

import DateFnsUtils from "@date-io/date-fns";

import {
  MuiPickersUtilsProvider,
  KeyboardDatePicker,
} from "@material-ui/pickers";
import axios from "axios";
import moment from "moment";
import config from "../../config";
// style
const styles = (theme) => ({
  root: {
    width: "100%",
    background: theme.palette.mainbackground.default,
    opacity: 1,
    padding: "30px 0px",
  },
  title: {
    fontSize: 16,
    fontWeight: 600,
    // color: "#012834"
  },
  card: {
    background: theme.palette.background.paper,
    boxShadow: "0px 5px 10px #00000014",
    borderRadius: 16,
    opacity: 1,
    margin: "20px 0px",
  },
  card_title: {
    borderBottom: `2px solid ${theme.palette.mainbackground.default}`,
    fontWeight: "bold",
    fontSize: 14,
    [theme.breakpoints.only("xs")]: {
      height: "20px",
    },
  },
  text_title: {
    padding: "6px 0px",
    opacity: 0.9,
  },
  body: {
    padding: "30px 0px",
  },
  btns: {
    margin: "20px 0px",
  },
  clear: {
    boxShadow: "0px 3px 6px #0049903D",
    border: `1px solid ${theme.palette.primary.main}`,
    opacity: 0.9,
    fontSize: 12,
    borderRadius: 8,
    fontWeight: 600,
  },
  submit: {
    border: `2px solid ${theme.palette.primary.main}`,
    background: theme.palette.primary.main,
    boxShadow: "0px 3px 6px #0049903D",
    borderRadius: 8,
    fontSize: 12,
    opacity: 0.9,
    marginRight: 12,
    "&:hover": {
      background: theme.palette.primary.main,
    },
  },
  d_icon: {
    margin: "auto",
    width: "100%",
    cursor: "pointer",
    textAlign: "center",
    color: theme.palette.primary.main,
    fontSize: 50,
  },
  d_title: {
    fontSize: 16,
    fontWeight: 600,
    textAlign: "center",
    color: theme.palette.secondary.main,
    opacity: 0.8,
    letterSpacing: 1,
    paddingBottom: "12px",
  },
  submit1: {
    marginTop: "35px",
    background: "#4BCD3E",
    boxShadow: "0px 3px 6px #0049903D",
    borderRadius: 8,
    fontSize: 12,
    opacity: 0.9,
    marginLeft: "20px",
    color: "#2A2A2A",
    [theme.breakpoints.only("xs")]: {
      marginLeft: "0px",
      marginTop: "0px !important",
      marginRight: "20px",
    },
  },
  submitbotton: {
    [theme.breakpoints.only("xs")]: {
      marginRight: "0px !important",
    },
    [theme.breakpoints.only("sm")]: {
      marginRight: "0px !important",
    },
  },
  d_btn: {
    textAlign: "center",
    margin: "auto",
    display: "flex",
    height: "40px",
    color: theme.palette.secondary.contrastText,
    fontSize: 16,
    textTransform: "capitalize",
    fontWeight: 600,
    boxShadow: "0px 10px 15px #70707028",
    background: theme.palette.primary.main,
    transition: "0.5s",
    "& button": {
      padding: 8,
    },
    "&:hover": {
      transition: "0.5s",
      background: theme.palette.primary.main,
      boxShadow: "0px 10px 15px #70707028",
      opacity: 0.9,
    },
  },
  input: {
    width: "100%",
  },
  profile: {
    borderBottom: `3px solid ${theme.palette.primary.main}`,
    background: theme.palette.background.paper,
    boxShadow: "0px 5px 10px #00000014",
    borderRadius: 8,
    width: "50%",
    margin: "auto",
    textAlign: "center",
    height: "50px",
    alignItems: "center",
    display: "flex",
    justifyContent: "center",
    fontWeight: 600,
    fontSize: 15,
    opacity: 0.8,
    [theme.breakpoints.only("xs")]: {
      width: "97%",
      height: "auto",
      padding: 6,
    },
  },
  phn: {
    color: theme.palette.primary.main,
    marginRight: 8,
    marginLeft: 6,
    [theme.breakpoints.only("xs")]: {
      marginTop: -12,
    },
  },
});
// end
const loginUser = localStorage.getItem('user_decode') ? JSON.parse(atob(localStorage.getItem('user_decode'))) : {};

class MyaccountComponent extends React.Component {
  // state
  constructor(props) {
    super(props);
    this.state = {
      submit: false,
      open: false,
      firstName: "",
      lastName: null,
      usertype: null,
      userId: null,
      activationDate: new Date(),
      expirationDate: new Date(),
      addressLine1: null,
      addressLine2: null,
      city: null,
      statevalue: null,
      pincode: null,
      country: null,
      phoneNumber: null,
      officeNumber: null,
      emailId: "",
      martial: "",
      middleName: "",
      gender: ""
    };
  }
  // data?.[0]?.customerEnquiryRes?.custDetailsResp?.[0]?.accountDetailsResp?.[0]?.cardDetailsResp?.[0]?.expDate
  // end
  componentDidMount() {
    debugger
    var loginUser = localStorage.getItem('user_decode') ? JSON.parse(atob(localStorage.getItem('user_decode'))) : {};
    // the fetch api
    const valData = {
      F: { value: "Female", label: "F" },
      M: { value: "Male", label: "M" },
    }
    const marriedStatusd = {
      S: { value: "Single", label: "S" },
      M: { value: "Married", label: "M" },
    };

    axios
      .get(`${config.api_url}api/v1/users/getAllRegisterCardDetail/${loginUser?.[0]?.userId}`)
      .then((res) => {
        if (res.data) {
          const data = res.data;
          this.setState({
            ...data,
            martial: marriedStatusd[data?.[0]?.customerEnquiryRes?.custDetailsResp?.[0]?.married],
            gender: valData[data?.[0]?.customerEnquiryRes?.custDetailsResp?.[0]?.gender],
            statevalue: data?.[0]?.customerEnquiryRes?.custDetailsResp?.[0].state,
            emailId: data?.[0]?.customerEnquiryRes?.custDetailsResp?.[0]?.email,
            areacode: data?.[0]?.customerEnquiryRes?.custDetailsResp?.[0].areacode ?? '',
            usertype: data?.[0]?.customerEnquiryRes?.custDetailsResp?.[0].userType?.type,
            firstName: data?.[0]?.customerEnquiryRes?.custDetailsResp?.[0]?.firstName ?? "",
            lastName: data?.[0]?.customerEnquiryRes?.custDetailsResp?.[0]?.lastName ?? "",
            addressLine1: data?.[0]?.customerEnquiryRes?.custDetailsResp?.[0]?.addressLine1 ?? '',
            addressLine2: data?.[0]?.customerEnquiryRes?.custDetailsResp?.[0]?.addressLine2 ?? "",
            addressLine3: data?.[0]?.customerEnquiryRes?.custDetailsResp?.[0]?.addressLine3 ?? "",
            city: data?.[0]?.customerEnquiryRes?.custDetailsResp?.[0]?.homeCity ?? "",
            pincode: data?.[0]?.customerEnquiryRes?.custDetailsResp?.[0]?.homePostCode ?? "",
            country: data?.[0]?.customerEnquiryRes?.custDetailsResp?.[0]?.homeCountryCode ?? "",
            phoneNumber: data?.[0]?.customerEnquiryRes?.custDetailsResp?.[0]?.mobNo ?? "",
            officeNumber: data?.[0]?.customerEnquiryRes?.custDetailsResp?.[0]?.officeNumber ?? "",
            emailId: data?.[0]?.customerEnquiryRes?.custDetailsResp?.[0]?.emailId ?? "",
            activationDate: moment(data.activationDate).format("MM/DD/YYYY"),
            expirationDate: moment(data.expirationDate).format("MM/DD/YYYY"),
            workcountry: data?.data?.[0]?.customerEnquiryRes?.custDetailsResp?.[0].workCountry ?? "",
            workaddressLine1: data?.data?.[0]?.customerEnquiryRes?.custDetailsResp?.[0].workAddRLine1 ?? "",
            workaddressLine2: data?.data?.[0]?.customerEnquiryRes?.custDetailsResp?.[0].workAddRLine2 ?? "",
            pcity: data?.data?.[0]?.customerEnquiryRes?.custDetailsResp?.[0].workCity ?? "",
            workstate: data?.data?.[0]?.customerEnquiryRes?.custDetailsResp?.[0].workCountyCode ?? "",
            workpincode: data?.data?.[0]?.customerEnquiryRes?.custDetailsResp?.[0].workPostCode ?? "",
          });
          localStorage.setItem("groupId", data.userGroupId);
          localStorage.setItem("userId", data.userId);
          localStorage.setItem("institutionId", data.institution?.instId);
        }
      })
      .catch((err) => {
        console.log("Profile details", err);
      });
  }
  handleChange = (n, v) => {
    const state = this.state;
    this.setState({
      ...state,
      [n]: v,
    });
  };
  handlesubmit = async() => {
    debugger
    await axios
      .post(`${config.api_url}api/v1/users/modifyDetails`, {
        approverId: "",
        checkerId: "",
        custUpdateReq: [{
          reqId: "",
          actionCode: "E",
          custCode: "",
          title: "",
          accNo: this.state.accNo ?? "",
          firstName: this.state.firstName ?? "",
          lastName: this.state.lastName ?? "",
          dateOfBirth: this.state.expirationDate ?? "",
          gender: this.state.gender?.label ?? "",
          married: this.state.married?.label ?? "",
          emailId: this.state.emailId ?? "",
          addressLine0: this.state.addressLine0 ?? "",
          addressLine1: this.state.addressLine1 ?? "",
          addressLine2: this.state.addressLine2 ?? "",
          addressLine3: this.state.addressLine3 ?? "",
          homeCity: this.state.homeCity ?? "",
          homeCountry: this.state.homeCountry ?? "",
          homeCountryCode: this.state.homeCountryCode ?? "",
          homeTel: this.state.homeTel ?? "",
          homePostCode: this.state.homePostCode ?? "",
          pobox: this.state.pobox ?? "",
          workAddRLine1: this.state.workAddRLine1 ?? "",
          workAddRLine2: this.state.workAddRLine2 ?? "",
          workAddRLine3: this.state.workAddRLine3 ?? "",
          workCity: this.state.workCity ?? "",
          workCountry: this.state.workCountry ?? "",
          workCountryCode: this.state.workCountryCode ?? "",
          workTel: this.state.workTel ?? "",
          workPostCode: this.state.workPostCode ?? "",
          idNumber: this.state.idNumber ?? "",
          nationalId: this.state.nationalId ?? "",
          mobNo: this.state.phoneNumber ?? "",
          mothername: this.state.mothername ?? "",
          middleName: this.state.middleName ?? "",
          kycTypeId: "1",
        }],
        flag: "S",
        makerId: "",
        remarks: "",
      })
      .then((res) => {
        if (res.data) {
          const data = res.data;
          this.setState({
            ...data,
          });
        }
      })
      .catch((err) => {
        console.log("Profile details", err);
      });
    this.props.history.push("/edit_profile");
  };
  // handle submit funcy
  // handlesubmit = () => {
  //     const state = this.state;
  //     this.setState({ ...state, submit: true, open: true })
  //     setTimeout(() => {
  //         this.setState({ submit: false });
  //         this.props.history.push("/home")
  //     }, 3000);
  // }
  // end
  render() {
    const { classes } = this.props;

    const {
      open,
      submit,
      firstName,
      lastName,
      usertype,
      userId,
      expirationDate,
      addressLine1,
      addressLine2,
      city,
      martial,
      statevalue,
      middleName,
      pincode,
      country,
      phoneNumber,
      officeNumber,
      emailId,
      gender
    } = this.state;

    return (
      <div className={classes.root}>
        <Container>
          {/* dialogbox component */}
          {submit && (
            <DialogComponent
              open={open}
              handleClose={this.handleClose}
              component={
                <div>
                  <CheckCircleOutlineIcon className={classes.d_icon} />
                  <Typography variant="subtitle2" className={classes.d_title}>
                    {" "}
                    User profile has been successfully modified.{" "}
                  </Typography>
                  <Button
                    variant="contained"
                    color="primary"
                    disableElevation
                    className={classes.d_btn}
                    onClick={() => this.props.history.push("/home")}
                  >
                    Ok
                  </Button>
                </div>
              }
            />
          )}
          {/* end */}

          {/* Breadcrumbs component */}

          {/* end */}

          {/* card component one*/}
          <Card className={classes.card} variant="outlined">
            <CardContent className={classes.card_title}>
              Cardholder Details
            </CardContent>
            <CardContent className={classes.card_title}>Personal</CardContent>

            <Container>
              <div className={classes.body}>
                <Grid container spacing={2}>
                  <Grid item xs={12} sm={6}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      First Name
                    </Typography>
                    <TextField
                      type="text"
                      size="small"
                      variant="outlined"
                      placeholder="First Name"
                      className={classes.input}
                      onChange={(e) =>
                        this.handleChange("firstName", e.target.value)
                      }
                      
                      value={firstName}
                    />
                  </Grid>
                  <Grid item xs={12} sm={6}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      Middle Name
                    </Typography>
                    <TextField
                      type="text"
                      size="small"
                      variant="outlined"
                      placeholder="Middle Name"
                      onChange={(e) =>
                        this.handleChange("middleName", e.target.value)
                      }
                      
                      value={middleName}
                      className={classes.input}
                    />
                  </Grid>
                  <Grid item xs={12} sm={6}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      Last Name
                    </Typography>
                    <TextField
                      type="text"
                      size="small"
                      variant="outlined"
                      placeholder="Last Name"
                      value={lastName}
                      onChange={(e) =>
                        this.handleChange("lastName", e.target.value)
                      }
                      
                      className={classes.input}
                    />
                  </Grid>
                  <Grid item xs={12} sm={6}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      Father/Husband's Name
                    </Typography>
                    <TextField
                      type="text"
                      size="small"
                      variant="outlined"
                      placeholder="Father Name"
                      onChange={(e) =>
                        this.handleChange("userId", e.target.value)
                      }
                      
                      value={userId}
                      className={classes.input}
                    />
                  </Grid>

                  <Grid item xs={12} sm={6}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      Mother's Maiden Name
                    </Typography>
                    <TextField
                      type="text"
                      size="small"
                      variant="outlined"
                      placeholder="Mother Name"
                      value={usertype}
                      onChange={(e) =>
                        this.handleChange("usertype", e.target.value)
                      }
                      
                      className={classes.input}
                    />
                  </Grid>

                  <Grid item container xs={12} sm={6}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      Martial status
                    </Typography>
                    <Autocomplete
                      fullWidth={false}
                      size="small"
                      style={{ width: "100%" }}
                      
                      value={this.state.martial}
                      name="reson"
                      options={[{ value: "Married", label: 'M' }, { value: "Single", label: "S" }]}
                      getOptionLabel={(option) => option.value}
                      onChange={(e, v) => this.handleChange("", v)}
                      renderInput={(params) => (
                        <TextField
                          {...params}
                          // helperText={
                          //   props.error?.mCountry &&
                          //   "Please enter your country Code"
                          // }
                          // error={props.error?.mCountry}
                          variant="outlined"
                          placeholder=""
                          className={classes.TextField}
                        />
                      )}
                    />
                  </Grid>

                  <Grid item xs={12} sm={6}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      Gender
                    </Typography>
                    <Autocomplete
                      fullWidth={false}
                      size="small"
                      style={{ width: "100%" }}
                      
                      value={gender}
                      name="reson"
                      options={[{ value: "Male", label: "M" }, { value: "Female", label: "F" }]}
                      getOptionLabel={(option) => option.value}
                      onChange={(e, v) => this.handleChange("", v)}
                      renderInput={(params) => (
                        <TextField
                          {...params}
                          // helperText={
                          //   props.error?.mCountry &&
                          //   "Please enter your country Code"
                          // }
                          // error={props.error?.mCountry}
                          variant="outlined"
                          placeholder=""
                          className={classes.TextField}
                        />
                      )}
                    />
                  </Grid>
                  <Grid item xs={12} sm={6}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      Email ID
                    </Typography>
                    <TextField
                      type="text"
                      size="small"
                      variant="outlined"
                      placeholder="Email ID"
                      
                      value={emailId?.toLowerCase()}
                      onChange={(e) =>
                        this.handleChange("email", e.target.value)
                      }
                      className={classes.input}
                    />
                  </Grid>
                  <Grid item container xs={12} sm={6} spacing={2}>
                    <Grid item xs={6}>
                      <Typography
                        variant="subtitle2"
                        className={classes.text_title}
                      >
                        Mobile Number
                      </Typography>
                      <Grid
                        item
                        container
                        xs={12}
                        sm={12}
                        spacing={0}
                        style={{ justifyContent: "space-between" }}
                      >
                        <Grid item xs={12} sm={3}>
                          <TextField
                            type="text"
                            size="small"
                            variant="outlined"
                            placeholder="country Code"
                            
                            value={"+91"}
                            onChange={(e) =>
                              this.handleChange("phoneNumber", e.target.value)
                            }
                            className={classes.input}
                          />
                        </Grid>
                        <Grid item xs={12} sm={8}>
                          <TextField
                            type="text"
                            size="small"
                            variant="outlined"
                            placeholder="Mobile Number"
                            
                            value={phoneNumber}
                            onChange={(e) =>
                              this.handleChange("phoneNumber", e.target.value)
                            }
                            className={classes.input}
                          />
                        </Grid>
                      </Grid>
                    </Grid>

                    <Grid item xs={6}>
                      <Typography
                        variant="subtitle2"
                        className={classes.text_title}
                      >
                        Office Number
                      </Typography>
                      <Grid
                        item
                        container
                        xs={12}
                        sm={12}
                        style={{ justifyContent: "space-between" }}
                      >
                        <Grid item xs={12} sm={3}>
                          <TextField
                            type="text"
                            size="small"
                            variant="outlined"
                            placeholder="Area Code"
                            
                            value={this.state.areacode}
                            onChange={(e) =>
                              this.handleChange("areacode", e.target.value)
                            }
                            className={classes.input}
                          />
                        </Grid>
                        <Grid item xs={12} sm={8}>
                          <TextField
                            type="text"
                            size="small"
                            variant="outlined"
                            placeholder="Office Number"
                            
                            value={officeNumber}
                            onChange={(e) =>
                              this.handleChange("officeNumber", e.target.value)
                            }
                            className={classes.input}
                          />
                        </Grid>
                      </Grid>
                    </Grid>
                  </Grid>
                  <Grid item xs={12} sm={6} style={{ marginLeft: "14px" }}>
                    <MuiPickersUtilsProvider utils={DateFnsUtils}>
                      <Typography
                        variant="subtitle2"
                        className={classes.text_title}
                      >
                        {" "}
                        Date of Birth
                      </Typography>
                      <KeyboardDatePicker
                        
                        style={{ width: "100%", margin: 0 }}
                        inputVariant="outlined"
                        margin="normal"
                        format="MM/dd/yyyy"
                        value={expirationDate}
                        onChange={(date) =>
                          this.handleChange("expirationDate", date)
                        }
                        KeyboardButtonProps={{
                          "aria-label": "change date",
                        }}
                        size="small"
                      />
                    </MuiPickersUtilsProvider>
                  </Grid>
                </Grid>

                <div>
                  <CardContent className={classes.card_title}>
                    Mailing Address
                  </CardContent>
                </div>
                <Grid container spacing={2} style={{ marginTop: "20px" }}>
                  <Grid item xs={12} sm={6}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      Address Line 1
                    </Typography>
                    <TextField
                      type="text"
                      size="small"
                      variant="outlined"
                      placeholder="Address Line 1"
                      
                      value={this.state.workaddress1}
                      onChange={(e) =>
                        this.handleChange("workaddress1", e.target.value)
                      }
                      className={classes.input}
                    />
                  </Grid>
                  <Grid item xs={12} sm={6}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      Address Line 2
                    </Typography>
                    <TextField
                      type="text"
                      size="small"
                      variant="outlined"
                      placeholder="Address Line 2"
                      
                      value={this.state.workaddress2}
                      onChange={(e) =>
                        this.handleChange("workaddress2", e.target.value)
                      }
                      className={classes.input}
                    />
                  </Grid>
                  <Grid item xs={12} sm={3}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      City
                    </Typography>
                    <TextField
                      type="text"
                      size="small"
                      variant="outlined"
                      placeholder="City"
                      
                      value={this.state.pcity}
                      onChange={(e) =>
                        this.handleChange("pcity", e.target.value)
                      }
                      className={classes.input}
                    />
                  </Grid>
                  <Grid item xs={12} sm={3}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      State
                    </Typography>
                    <TextField
                      type="text"
                      size="small"
                      variant="outlined"
                      placeholder="State"
                      
                      value={this.state.workstate}
                      onChange={(e) =>
                        this.handleChange("statevalue", e.target.value)
                      }
                      className={classes.input}
                    />
                  </Grid>
                  <Grid item xs={12} sm={3}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      PIN Code
                    </Typography>
                    <TextField
                      type="text"
                      size="small"
                      variant="outlined"
                      placeholder="PIN Code"
                      
                      value={this.state.workpincode}
                      onChange={(e) =>
                        this.handleChange("pincode", e.target.value)
                      }
                      className={classes.input}
                    />
                  </Grid>
                  <Grid item xs={12} sm={3}>
                    <Typography
                      variant="subtitle2"
                      className={classes.text_title}
                    >
                      Country
                    </Typography>
                    <TextField
                      type="text"
                      size="small"
                      variant="outlined"
                      placeholder="Country"
                      
                      value={this.state.workcountry}
                      onChange={(e) =>
                        this.handleChange("country", e.target.value)
                      }
                      className={classes.input}
                    />
                  </Grid>

                  <div>
                    <CardContent className={classes.card_title}>
                      Permanent Address
                    </CardContent>{" "}
                    <CheckboxLabels style={{ marginTop: "100px" }} />
                  </div>

                  <Grid container spacing={2} style={{ marginTop: "0px" }}>
                    <Grid item xs={12} sm={6}>
                      <Typography
                        variant="subtitle2"
                        className={classes.text_title}
                      >
                        Address Line 1
                      </Typography>
                      <TextField
                        type="text"
                        size="small"
                        variant="outlined"
                        placeholder="Address Line 1"
                        
                        value={addressLine1}
                        onChange={(e) =>
                          this.handleChange("addressLine1", e.target.value)
                        }
                        className={classes.input}
                      />
                    </Grid>
                    <Grid item xs={12} sm={6}>
                      <Typography
                        variant="subtitle2"
                        className={classes.text_title}
                      >
                        Address Line 2
                      </Typography>
                      <TextField
                        type="text"
                        size="small"
                        variant="outlined"
                        placeholder="Address Line 2"
                        
                        value={addressLine2}
                        onChange={(e) =>
                          this.handleChange("addressLine2", e.target.value)
                        }
                        className={classes.input}
                      />
                    </Grid>
                    <Grid item xs={12} sm={3}>
                      <Typography
                        variant="subtitle2"
                        className={classes.text_title}
                      >
                        City
                      </Typography>
                      <TextField
                        type="text"
                        size="small"
                        variant="outlined"
                        placeholder="City"
                        
                        value={city}
                        onChange={(e) =>
                          this.handleChange("city", e.target.value)
                        }
                        className={classes.input}
                      />
                    </Grid>
                    <Grid item xs={12} sm={3}>
                      <Typography
                        variant="subtitle2"
                        className={classes.text_title}
                      >
                        State
                      </Typography>
                      <TextField
                        type="text"
                        size="small"
                        variant="outlined"
                        placeholder="State"
                        value={statevalue}
                        onChange={(e) =>
                          this.handleChange("statevalue", e.target.value)
                        }
                        className={classes.input}
                      />
                    </Grid>
                    <Grid item xs={12} sm={3}>
                      <Typography
                        variant="subtitle2"
                        className={classes.text_title}
                      >
                        PIN Code
                      </Typography>
                      <TextField
                        type="text"
                        size="small"
                        variant="outlined"
                        placeholder="PIN Code"
                        value={pincode}
                        onChange={(e) =>
                          this.handleChange("pincode", e.target.value)
                        }
                        className={classes.input}
                      />
                    </Grid>
                    <Grid item xs={12} sm={3}>
                      <Typography
                        variant="subtitle2"
                        className={classes.text_title}
                      >
                        Country
                      </Typography>
                      <TextField
                        type="text"
                        size="small"
                        variant="outlined"
                        placeholder="Country"
                        value={country}
                        onChange={(e) =>
                          this.handleChange("country", e.target.value)
                        }
                        className={classes.input}
                      />
                    </Grid>
                  </Grid>
                </Grid>

                <Grid
                  container
                  direction="row"
                  justify="space-between"
                  alignItems="end"
                  className={classes.btns}
                >
                  <Grid
                    item
                    xs={12}
                    sm={12}
                    className={classes.submitbotton}
                    style={{ textAlign: "end", marginRight: "20px" }}
                  >
                    <Button
                      variant="contained"
                      className={classes.submit1}
                      onClick={() => this.handlesubmit()}
                    >
                      Modify Details
                    </Button>
                  </Grid>
                </Grid>
              </div>
            </Container>
          </Card>
          {/* end */}

          {/* PhoneInTalkIcon section */}

          {/* end */}
        </Container>
      </div>
    );
  }
}

export default withStyles(styles)(withRouter(MyaccountComponent));
